import React from 'react';
import './MediumCard.css';

const MediumCard = () =>{
    return (
        <article className="card">
        <ImageContainer image="https://cdn.vox-cdn.com/thumbor/gl6Ss1kHw9REtww2xEZPEYeD-f4=/0x106:880x601/280x158/filters:format(webp)/cdn.vox-cdn.com/uploads/chorus_image/image/67298922/Screen_Shot_2020_08_26_at_2.27.31_PM.0.png"/>
        <CardBody date={'March 15, 2020'} title={"Youtubers Partying During Pandemic"} text={'Breaking down every fantasy-relevant situation to prepare you for your 2020 draft.'}/>
        </article>
    );
}

const ImageContainer = (props) =>{
    return(
        <div className="img-container" style={{backgroundImage: `url('${props.image}')`}}>

        </div>
    );
}

const CardBody = (props) => {
    return (
        <div className="card-body">
            <p className="date">{props.date}</p>
            <h2>{props.title}</h2>
            <p className="body-content">{props.text}</p>
        </div>
    )
}

export default MediumCard;
